package com.jlt.vote.bis.campaign.vo;import java.io.Serializable;import java.util.Date;import java.util.List;/** * 用户礼物 * @Author gaoyan * @Date: 2017/7/8 */public class UserGiftVo implements Serializable {	/**	 * 用户头像	 */	private String headImgUrl;    /**     * 投票用户名称	 */	private String nickName;	/**	 * 投票时间	 */	private Date voteTime;    /**     * 礼物数	 */	private Integer giftCount;	/**     * 礼物名称	 */	private String giftName;	public String getHeadImgUrl() {		return headImgUrl;	}	public void setHeadImgUrl(String headImgUrl) {		this.headImgUrl = headImgUrl;	}	public String getNickName() {		return nickName;	}	public void setNickName(String nickName) {		this.nickName = nickName;	}	public Date getVoteTime() {		return voteTime;	}	public void setVoteTime(Date voteTime) {		this.voteTime = voteTime;	}	public Integer getGiftCount() {		return giftCount;	}	public void setGiftCount(Integer giftCount) {		this.giftCount = giftCount;	}	public String getGiftName() {		return giftName;	}	public void setGiftName(String giftName) {		this.giftName = giftName;	}}